import React from 'react';
import './DiscoverTrailers.css';

function TrailerList(props){

      
    const style={
        backgroundImage:`url('https://image.tmdb.org/t/p/original${props.discover.poster_path}')`
         };
    return(
        
        <div className="browse-movies">
                   
            <div className="movie-picture" style={style}>
            <div className="vote fa fa-heart"></div>
            <div className="text">{"  "+ props.discover.vote_average}</div>
            <div className="watch">
            <button>{props.title}</button></div>
            </div>
            
            <div className="movie-details">{props.discover.title}</div>
            
        </div>
    )
};
TrailerList.defaultProps = {
    title: 'watch'
  }

export default TrailerList;
